import Jogo from './Jogo';

function FaseEliminatoria({ jogos, onAtualizarPlacar }) {
  const handleSubmitScore = (jogo, placar) => {
    onAtualizarPlacar(jogo, placar); // Esta função será definida no App.js ou em outro componente pai
  };

  return (
    <div>
      {jogos.map((jogo, index) => (
        <div key={index}>
          <h4>{jogo.fase}</h4>
          <Jogo 
            jogo={jogo} 
            onSubmeterPlacar={handleSubmitScore}
            onAtualizarPlacar={() => {}} // Placeholder, não usada neste exemplo
          />
        </div>
      ))}
    </div>
  );
}

